 Name: UserSeedValueMethodTemplate
 ID: 55
 DataType: method
 RandomSeed: 157
 Value: |+1
  /*
  User method for defining the random processes of an observation
  By default the random model components behave the same for all observations with same number.
  This method is known as Common Random Numbers (CRN).
  Therefore observations of different experiments can depend on each other.
  Statistics applications like the Analysis of Variance (ANOVA) need independent observations for the same experiment as well as for different experiments.
  To make sure that all observations are independent of each other, use the following template.
  Note that the attribute 'NumRuns' of the ExperimentManager (access is possible via ?.~) is the number of observations of the experiments,
  which you entered into the text box Observations per experiment on the tab Definition.  
  */
  param ExpNo,ObservNo:integer
  eventController.RandomNumbersVariant := ObservNo + ?.~.NumRuns * (ExpNo - 1)
